export const CLOSE_MOUDULE = "closemodule";
export const SHOW_DATA = "init";
export const closeModal = (dispatch) => () => {
  dispatch({
    type: CLOSE_MOUDULE,
    payload: {
      isclose: true,
    },
  });
};

export const initdata = (dispatch) => () => {
  fetch("/alldata")
    .then((res) => res.json)
    .then((data) =>
      dispatch({
        type: SHOW_DATA,
        payload: data,
      })
    );
};
